class FabsValidationRules:
    def __init__(self):
        self.rules = {}

    def add_rule(self, rule_name, rule_function):
        self.rules[rule_name] = rule_function

    def validate(self, submission):
        for rule_name, rule_function in self.rules.items():
            if not rule_function(submission):
                return False, rule_name
        return True, None

